void rly_uartch(char ch) {
  while (!(IFG2 & UCA0TXIFG));
  UCA0TXBUF = ch;
}

void rly_uarts(char* s) {
  while (*s) {
    rly_uartch(*s);
    ++s;
  }
}

void rly_uartint(long i) {
  const char nums[] = "0123456789";
  char tmp[6];
  int l = 0;
  if (i == 0) {
    rly_uartch(nums[0]);
    return;
  }
  if (i < 0) {
    rly_uartch('-');
    i = -i;
  }
  while (i) {
    tmp[4-l] = nums[i % 10];
    i = i / 10;
    ++l;
  }
  tmp[5] = '\0';
  rly_uarts(tmp + 5 - l);
}

char buf[6];
int fill = 0;
void uart_ch(char ch);

void FLUSH() {
  if (fill > 6) fill = 6;
  for (int i = fill; i > 0; --i) {
    rly_uartch(buf[6-i]);
  }
}

uint8_t window[256];
int last_offset = -1, off = 0;

void OFFSET(int offset) {
  last_offset = offset;
}

void LITERAL(int literal) {
  if (last_offset > 0) {
    for (int i = 0; i < literal; ++i) {
      const uint8_t c = window[(256 + off - last_offset) % 256];

      window[off] = c;
      off = (off + 1) % 256;

      uartch(c);
    }
    last_offset = -1;
  } else {
    window[off] = (char) literal;
    off = (off + 1) % 256;
    uartch((char)literal);
  }
}

